(68, 4, '2012-03-28 21:34:59', 'Magento Community Preview Version CE 1.7.0.0-RC1 has been released!', 'Learn more about the exciting new features and updates in this release and how you can take it for a test drive. As this is a preview version, we need to stress that it’s likely unstable and that we DON’T recommend that you use it in any production environment just yet.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/', 0, 0),
(69, 4, '2012-04-24 14:49:13', 'Magento Community 1.7 and Magento Enterprise 1.12 now available!', 'Learn more about the exciting new features and updates in these releases.', 'http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/', 0, 0),
(70, 3, '2012-04-18 05:27:43', 'Custom Stock Display v.1.1 by aheadWorks has been released!', 'We released a new version of Magento module that will help avoid constant questions on the stock status.', 'http://blog.aheadworks.com/2012/04/keep-your-customers-informed/?utm_source=feed&utm_medium=zefeed&utm_campaign=CSD_1_1', 0, 0),
(71, 3, '2012-04-06 05:01:52', 'Advanced Search v.1.2 and Knowledge Base v.1.2 by aheadWorks have been released!', 'We released new versions of Magento modules that will help show careful attitude to your clients.', 'http://blog.aheadworks.com/2012/04/caring-attitude-is-the-key-to-long-term-client-relationship/?utm_source=feed&utm_medium=zefeed&utm_campaign=AS_1_2_KB_1_2', 0, 0),
(72, 3, '2012-03-30 05:19:57', 'Easy Categories v.1.1 and Image Slider v.1.3 by aheadWorks have been released!', 'We released new versions of Magento modules that will be helpful in making your website appealing for your clients.', 'http://blog.aheadworks.com/2012/03/images-are-the-best-way-of-grabbing-attention/?utm_source=feed&utm_medium=zefeed&utm_campaign=EC_1_1_IS_1_3', 0, 0),
(73, 3, '2012-03-23 07:00:20', 'Advanced Reports v.2.3 and Additional Units by aheadWorks have been released!', 'The new version of Advanced Reports is compatible with Magento CE 1.6.2.0. Don''t forget to update additional units as well.', 'http://blog.aheadworks.com/2012/03/get-detailed-and-accurate-sales-information-easily/?utm_source=feed&utm_medium=zefeed&utm_campaign=AR_2_3_Units', 0, 0),
(74, 3, '2012-03-20 12:25:50', 'iPhone Theme v.1.4.1 by aheadWorks has been released', 'The new version detects iPad automatically that means the desktop version of your online store will be displayed. ', 'http://blog.aheadworks.com/2012/03/be-mobile-and-get-more-potential-traffic/?utm_source=feed&utm_medium=zefeed&utm_campaign=iPhone_Theme_1_4_1', 0, 0),
(75, 3, '2012-03-14 10:55:57', 'Z-Blocks 2.2.6, Market Segmentation Suite 1.2.1, Follow Up Email 3.4, and Advanced Newsletter 2.2 by aheadWorks have been released!', 'Today we release the Magento extensions that were modified for you to get the best results in your target marketing. With their help, your promotions and sales become easier and more cost-effective.', 'http://blog.aheadworks.com/2012/03/divide-and-conquer-with-the-newest-versions-of-our-magento-extensions/?utm_source=feed&utm_medium=zefeed&utm_campaign=FUE_34_MSS_121_ZB_226_AN_22', 0, 0),
(76, 3, '2012-03-06 12:10:58', 'Advanced Reviews 2.2.1 and Product Questions 1.4.4 by aheadWorks have been released!', 'Listen to your customers and show interest in their opinion with powerful extensions from aheadWorks.', 'http://blog.aheadworks.com/2012/03/listen-to-your-customers-show-interest-in-their-opinion/?utm_source=feed&utm_medium=zefeed&utm_campaign=AR_2_2_1_PQ_1_4_4', 0, 0),
(77, 3, '2012-03-01 12:05:24', 'Product Preview Pro 1.1 and Home Tabs Pro 1.2.1 by aheadWorks have been released!', 'Broaden standard Magento possibilities and enlarge your store usability with Product Preview Pro 1.1 and Home Tabs Pro 1.2.1', 'http://blog.aheadworks.com/2012/03/welcome-the-latest-versions-of-home-tabs-pro-and-product-preview-pro/?utm_source=feed&utm_medium=zefeed&utm_campaign=PPP_1_1_HT_1_2_1', 0, 0),
(78, 3, '2012-02-28 12:42:15', 'Countdown v.1.0 by aheadWorks has been released!', 'The Countdown Magento extension counts backward to indicate the time remaining for/before promotions, sales, discounts, registrations, or whatever else.', 'http://blog.aheadworks.com/2012/02/three-two-one-countdown/?utm_source=feed&utm_medium=zefeed&utm_campaign=Countdown_1_0', 0, 0),
(79, 3, '2012-02-23 12:00:13', 'AJAX Cart Pro v.2.4 by aheadWorks has been released!', 'Minor bugs have been fixed in the new version of the AJAX Cart Pro extension.', 'http://blog.aheadworks.com/2012/02/make-buying-process-comfortable-with-new-ajax-cart-pro-version/?utm_source=feed&utm_medium=zefeed&utm_campaign=ACP_2_4', 0, 0),
(80, 3, '2012-04-27 05:00:35', 'Subscriptions and Recurring Payments v.1.7, Automatic Product Callouts v.1.2, and Product Updates Notifications v.1.2 by aheadWorks have been released!', 'Get New Opportunities with Our Extensions Updates!', 'http://blog.aheadworks.com/2012/04/get-new-opportunities-with-our-extensions-updates/?utm_source=feed&utm_medium=zefeed&utm_campaign=SARP_1_7_APC_1_2_PUN_1_2', 0, 0),
